import React from "react";
import avatar from "../../images/img_avatar.png";
import { Sidebar as SideNav } from "../../styledComponents/Dashboard/dashbordSideBar";
const Sidebar = () => {
  return (
    <SideNav>
      <div>
        <img src={avatar} />
      </div>
    </SideNav>
  );
};

export default Sidebar;
